import AboutHero from "../Components/AboutHero";
import Navbar from "../Components/Navbar";
import Footer from "../Components/Footer";

const AboutPage = () => {
    return ( 
      <>
        <Navbar/>
        <AboutHero/>
        <Footer/>
      </>
     );
}
 
export default AboutPage;
